column3:
Nossa #tbt de hoje é especial! A aula inaugural 2018 do curso de administração, que teve como tema: 
&quot;Gestão de carreira para jovens universitários! Como planejar?&quot; 
Ministrada pela professora Vanessa Cepellos da Fundação Getúlio Vargas. Além da palestra os alunos receberam o seu registro profissional de administrador das mãos de Daniel Menezes, representante do Conselho Regional de Administração (CRA).

Fala galera!!!
Tá no ar mais um &quot;Formei, e aí?&quot;

Nossa personagem de hoje é a Fernanda Silva, ex-aluna de administração. Participe você também, mande sua história pra nós.
